import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";
function App() {
  return (
    <>
      <Header />
      <main className="my-3">
        <Container>
          <h1>Ecommerce App</h1>

          <Home />
        </Container>
      </main>
      <Footer />
    </>
  );
}

export default App;
